import React from 'react';
import Navbar from './Navbar';

export default function SystemPage({ user, onLogout }) {
  return (
    <>
      <Navbar user={user} onLogout={onLogout} />
      <div className="p-6">
        <h2 className="text-2xl font-semibold mb-4">System (Preview)</h2>
        <p>Admin system controls and metrics will appear here.</p>
      </div>
    </>
  );
}
